import { Row, Col } from 'react-bootstrap';
import { useDispatch } from 'react-redux';
import { fetchRecipes } from '../actions';

const RecipesList = () => {

  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(fetchRecipes(1));
  }, [dispatch]);
  
  return (
    <>
      <Row>
        <Col xs={6} md={4}>
          <h1>Recipes List</h1>
        </Col>
      </Row>
    </>
  );
}

export default RecipesList;
